import React from 'react'

const RegistrationForm = () => {
    return(
        <div className="flex flex-col items-center h-screen bg-gradient-to-r from-violet-600 to-indigo-600">
            <h1 className="text-6xl font-bold text-center text-white">Registration Form</h1>
            <form className="max-w-sm mx-auto mt-8">
                <div className="flex flex-col space-y-4">
                    <label htmlFor="genres_multiple1" className="block mb-2 text-sm font-medium text-gray-900">Select Favorite Movie Genres</label>
                    <select multiple id="genres_multiple1" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm round-lg block w-full p-2.5">
                        {/* your options */}
                    </select>
                    <label htmlFor="genres_multiple2" className="block mb-2 text-sm font-medium text-gray-900">Select More Favorite Movie Genres</label>
                    <select multiple id="genres_multiple2" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm round-lg block w-full p-2.5">
                        {/* your options */}
                    </select>
                </div>
            </form>
        </div>
    )
}

export default RegistrationForm;
